    modifier onlyBank() virtual { checkOnlyBank(); _; }

    function ownerOf() public view virtual override (IWallet,Ownable) returns (address)
    {
        return Ownable.ownerOf();
    }
    function supportsInterface(bytes4 interfaceId)
        public virtual
        view 
        returns (bool)
    {
        return interfaceId == type(IERC165).interfaceId || interfaceId == type(IWallet).interfaceId;
    }
