    mapping(bytes32 => uint256) private _credit;

    function granularity(uint256 granularity_) public pure returns (uint256)
    {return granularity_; }

    function account() public view returns (bytes32[] memory,Currency[] memory out_)
    {
        uint len = _currencies.length;
        out_ = new Currency[](len);
        for (uint i;i<len;i++)
            out_[i] = _account[_currencies[i]];
        return (_currencies,out_);
    }
    function accountCurrencies() public view returns (bytes32[] memory)
    {
        return _currencies;
    }
    function accountCurrencyBatch(bytes32[] calldata currency_) public view returns (Currency[] memory out_)
    {
        uint len = _currencies.length;
        out_ = new Currency[](len);
        for (uint i;i<len;i++)
            out_[i] = _account[currency_[i]];
    }
    function accountCurrency(bytes32 currency_) external view returns (Currency memory)
    {
        return _account[currency_];
    }





    function _creditUsed(Currency storage account_)
        internal
        view
        returns (uint256)
    {
        return account_.credit + account_.collateralcredit;
    }

    function _creditAvailable(Currency storage account_)
        internal
        view
        returns (uint256)
    {
        if (!bank.allowCredit()) return 0;
        if (
            _creditUsed(account_) >
            account_.allowance + account_.collateralallowance
        ) return 0;
        return
            account_.allowance +
            account_.collateralallowance -
            _creditUsed(account_);
    }
    function _unstackable(Currency storage account_)
        internal
        view
        returns (uint256)
    {
        if (
            (_creditUsed(account_) > 0) ||
            (account_.collateral > account_.balance)
        ) return 0;
        return account_.balance - account_.collateral;
    }

    function _changed(bytes32 currency_, Currency memory account_) internal virtual {
    }


    function _balanceAdd(
        bytes32 currency_,
        Currency storage account_,
        uint256 amount_
    ) internal {
        if (amount_ != 0) {
            //bool creditchanged;
            if (account_.credit > 0) {
                if (account_.credit >= amount_) {
                    account_.credit -= amount_;
                    //credit_ -= amount_;
                    amount_ = 0;
                } else {
                    amount_ -= account_.credit;
                    //credit_ -= account_.credit;
                    account_.credit = 0;
                }
                //creditchanged = true;
            }
            //bool creditcollateralchanged;
            if (account_.collateralcredit > 0) {
                if (account_.collateralcredit >= amount_) {
                    account_.collateralcredit -= amount_;
                    //credit_ -= amount_;
                    amount_ = 0;
                } else {
                    amount_ -= account_.collateralcredit;
                    //credit_ -= account_.collateralcredit;
                    account_.collateralcredit = 0;
                }
                //creditcollateralchanged = true;
            }
            //bool balancechanged;
