            //    (!creditcollateralchanged) &&
            //    (balancechanged)
            //) _accounts[_key].m = _account.m;
            //else _accounts[_key] = _account;
            _changed(currency_, account_);
        }
    }

    function _balanceSub(
        bytes32 currency_,
        Currency storage account_,
        uint256 amount_
    ) internal {
        if (amount_ != 0) {

            require(
                (account_.balance +
                        _creditAvailable(account_) >=
                        amount_),
                "Not enought balanceOf/credit allowance"
            );
            //bool creditcollateralchanged;
            if (amount_ > account_.balance) {
                uint256 newcredit = amount_ - account_.balance;
                uint256 collateralcreditavail = account_.collateralallowance - account_.collateralcredit;
                if (newcredit > collateralcreditavail)
                    newcredit = collateralcreditavail;
                account_.collateralcredit += newcredit;
                amount_ -= newcredit;
                //creditcollateralchanged = true;
            }
            //bool creditchanged;
            if (amount_ > account_.balance) {
                uint256 newcredit = amount_ - account_.balance;
                uint256 creditavail = account_.allowance -
                    account_.credit;
                if (newcredit > creditavail) newcredit = creditavail;
                account_.credit += newcredit;
                amount_ -= newcredit;
                //creditchanged = true;
            }
            //bool balancechanged;
            if (amount_ > 0) {
                account_.balance -= amount_;
                //balancechanged = true;
            }
            /*if ((creditchanged || creditcollateralchanged) && (!balancechanged))
                _accounts[_key].e = _account.e;
            else if (
                (!creditchanged) &&
                (!creditcollateralchanged) &&
                (balancechanged)
            ) _accounts[_key].m = _account.m;
            else _accounts[_key] = _account;*/
            _changed(currency_, account_);
        }
    }

