    function stake(address token_, uint256 amount_) public payable
    {
        stake(bank.currency(token_,0),amount_);
    }
    function stake(address token_, uint256 tokenid_,uint256 amount_) public payable
    {
        stake(bank.currency(token_,tokenid_),amount_);
    }
    function stake(bytes32 currency_, uint256 amount_) onlyOwner public payable
    {
        _stake(currency_,msg.sender,_account[currency_],amount_);
    }

    function _stake(
        bytes32 currency_,
        address sender_,
        Currency storage account_,
        uint256 amount_
    ) internal {
        if (amount_ == 0) return;
        require(amount_==granularity(amount_),"Granularity failed");
        if (bank.supportsInterface(currency_,type(IBankeable).interfaceId)) 
            require(
                IBankeable(bank.currencyResolveToken(currency_)).bankeable(),
                "Token not bankeable"
            );


        if (!bank.modeTest()) {
        if (bank.isFeatureType(currency_,Token.TypeCurrency)) {} 
        else if (bank.isFeatureType(currency_,Token.TypeERC20))
                IERC20(bank.currencyResolveToken(currency_)).transferFrom(
                    sender_,
                    address(this),
                    amount_
                );
        }

        _balanceAdd(currency_, account_, amount_);
    }

    function unstake(address token_, uint256 amount_) public
    {
        unstake(bank.currency(token_,0),amount_);
    }
    function unstake(address token_, uint256 tokenid_, uint256 amount_) public
    {
        unstake(bank.currency(token_,tokenid_),amount_);
    }

    function unstake(bytes32 currency_, uint256 amount_) onlyOwner public
    {
        _unstake(currency_,msg.sender,_account[currency_],amount_);
    }
    function _unstake(
        bytes32 currency_,
        address taker_,
        Currency storage account_,
        uint256 amount_
    ) private {
        if (amount_ == 0) return;
        require(amount_==granularity(amount_),"Granularity failed");
        require(_unstackable(account_) >= amount_);

        if (!bank.modeTest()) {
            if (bank.isFeatureType(currency_,Token.TypeCurrency))
                payable(taker_).transfer(amount_);
            else if (bank.isFeatureType(currency_,Token.TypeERC20))
                IERC20(bank.currencyResolveToken(currency_)).transfer(taker_, amount_);
        }

        _balanceSub(currency_, account_, amount_);
    }

